import 'bootstrap/dist/css/bootstrap.min.css'
import Axios from 'axios'
import { useState, useEffect, act } from 'react'
import './App.css';
import Login from './Login';
import Manifiestos from './Manifiestos';
import Empleado from './Empleado';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom'


function App() {
  const [activeSection, setSection] = useState('Login')

  const renderSection = () => {
    if (activeSection === 'Login') return <Login setSection={setSection} />

    if (activeSection === 'Empleado') return <Empleado />

    if (activeSection === 'Manifiesto') return <Manifiestos />
  }

  return (
    <Router>
      <div className="bg-blue text-light" style={{ height: '100vh' }}>
      </div>
    </Router>
  );
}

export default App;
